import {CHANGE_BG, RESET_BG} from './bg.actionType'

let changeBG = () =>{
    return {
        type: CHANGE_BG,
        payload: "change background"
    }
}

let resetBG = () =>{
    return {
        type: RESET_BG,
        payload: "reset background"
    }
}

export {changeBG,resetBG}
